import React, { useState } from "react";
import Tour from "./Tour";

const Tours = () => {
  const [show, setShow] = useState(false);
  {
    data.filter((tour, id) => {
      return (
        <>
          <button className="delete-btn" onClick={(id) => setShow(!show)}>
            not interested
          </button>
          {show && <Tour key={tour.id} tour={tour} />}
        </>
      );
    });
  }
};

export default Tours;
